// ==/UserScript==

function addGlobalStyle(css) {
    var head, style;
    head = document.getElementsByTagName('head')[0];
    if (!head) { return; }
    style = document.createElement('style');
    style.type = 'text/css';
    style.innerHTML = css;
    head.appendChild(style);
}

function getLocalCoords(event, element){
    var rect = element.getBoundingClientRect();
    return {x: event.clientX - rect.left, y: event.clientY - rect.top};
}

function createObserver($player) {
   var timeoutID;
   var stopCount = 0;
   function updateToolbarRating() {
       var $ratingContainer = $player.find('.rating-container.materialThumbs');
       if($ratingContainer.length === 0) {
           return;
       }
       //console.log('REQUESTED');
       
       if(stopCount >= 2) {
           stopCount = 0;
           return;
       }
       var rating = $('tr.currently-playing td[data-col=rating]').attr('data-rating');
       if(rating == undefined) {
           if($('#queue-overlay').is(":visible")) return;
           ++stopCount;
           // console.log('RATING BOTCHED');
           $('#queue').click();
           return updateToolbarRating();
       }

       $ratingContainer.attr('data-rating', rating);
       $ratingContainer.removeAttr('data-rating-hover');
       stopCount = 0;
       
       //console.log('UPDATED');
   }
   var observer = new MutationObserver(function(mutations) {
      //console.log('MUTATED');
      //mutations.forEach(function(mutation) {
      //    console.log(mutation.type, mutation.attributeName);
      //});
      //console.log('===================');
      clearTimeout(timeoutID);
      //cuts down on the frequency of the updates
      timeoutID = setTimeout(updateToolbarRating, 500);      

   });
   
   return observer;
}

var sBrowser, sUsrAg = navigator.userAgent;

if (sUsrAg.indexOf("Firefox") > -1) {
    sBrowser = "Mozilla Firefox";
}

$(document).ready(function() {
   var $player = $('#player');
   var $songTable = $('#queue-overlay');
   var observer = createObserver($player);
   
   observer.observe($player[0], sBrowser === "Mozilla Firefox" ? {attributes: true} : {attributes: true, attributeFilter: ['tabindex'], subtree: true});
});


//image dimensions
var ws = 51, ls = 18, w = 320, h = 82;

function calculateRating(event, $element) {
    var coords = getLocalCoords(event, $element[0]);

    var height = $element.height();
    var width = $element.width();
    var rate = Math.min(width/w, height/h);
    width = (w -2*ls) * rate;
    var fifth = width/5+2;

    var dataRating = Math.floor((coords.x + fifth - ls*rate)/fifth);
    if(dataRating > 5) dataRating = 0;

    return dataRating;
}

var dblclick = false;

$(document).on('mousemove', 'td[data-col=rating], .rating-container.materialThumbs', function(event) {
    var $this = $(this);
    var rating = calculateRating(event, $this);
    $this.attr('data-rating-hover', rating);
    var oldRating = $this.attr('data-rating');
    if(oldRating == rating) rating = 0;
   
    //workaround for two subsequent thumbup/down cancelling each other
    $this.find('li:first-child, paper-icon-button:first-child').attr('data-rating', rating);
    dblclick = ((oldRating == 2 && rating == 1) || (oldRating == 4 && rating == 5)) && (this.tagName === 'TD');
});

$(document).on('click', 'td[data-col="rating"] > .rating-container.thumbs > li:first-child', function(event){
   if(dblclick) {
      dblclick = false;
      event.target.click();
   }
});



